import React from 'react';
import { Link } from 'react-router-dom';
import { connect } from 'react-redux';
import { compose } from 'redux';
import WireFrameCard from './WireFrameCard';

class WireFrameLinks extends React.Component {
    render() {
        const wireFrames = this.props.wireFrames;
        console.log(wireFrames);
        return (
            <div className="todo-lists section">
                {wireFrames && wireFrames.filter(wireFrame => wireFrame.owner === this.props.uid).map(wireFrame => (
                    <Link to={'/wireFrame/' + wireFrame.id} key={wireFrame.id}>
                        <WireFrameCard className="center-align" wireFrame={wireFrame} />
                    </Link>
                ))}
            </div>
        );
    }
}

const mapStateToProps = (state) => {
    console.log(state.firebase.auth.uid)
    return {
        wireFrames: state.firestore.ordered.wireframes,
        auth: state.firebase.auth,
    };
};

export default compose(connect(mapStateToProps))(WireFrameLinks);
